        public static IList<Product> SearchProduct(string query)
        {
            if (string.IsNullOrWhiteSpace(query))
                return _products;

            var ret = new List<Product>();
            foreach(var item in _products)
            {
                if (item.Name.Contains(query) || item.ShortDescription.Contains(query))
                    ret.Add(item);
            }

            return ret;
        }

